import './App.css';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import MainLogin from "./Component/Login"
import Signup from "./Component/Signup"
import UserHomePage from "./Component/UserHomePage"
import UserLogin from "./Component/UserLogin";
import BreederLogin from "./Component/BreederLogin";
import BreederHomePage from "./Component/BreederHomePage"
import React, { useState, useEffect } from 'react';
import BreederProfile from "./Containers/BreederProfile"
import Dog from "./Containers/Dog"

// userRequestDog = () => {
//   debugger
// }


function App() {
  const [dog, setDog] = useState([])
  const [user, setUser] = useState([])
  const [breeder, setBreeder] = useState([])


  useEffect(() => {
    fetch("http://localhost:3000/pets")
    .then(res => res.json())
    .then(dogs => setDog(dogs))

    fetch("http://localhost:3000/")
    .then(res => res.json())
    .then(users => setUser(users))

    fetch("http://localhost:3000/sellers")
    .then(res => res.json())
    .then(breeder => setBreeder(breeder))


  }, [])

  return (
    <Router>
    <div className="App">

      <Switch>
          <Route exact path="/" component={(props) => (
            <MainLogin {...props}  />
          )} />

          <Route exact path="/userlogin" component={(props) => (
            <UserLogin {...props} />
          )} />

          <Route exact path="/breederlogin" component={(props) => (
            <BreederLogin {...props} />
          )} />   

            <Route exact path="/signup" component={(props) => (
            <Signup {...props} />
          )} /> 

            <Route exact path="/userhomepage" component={(props) => (
            <UserHomePage dog
            // userRequestDog={this.userRequestDog} 
            />
          )} /> 

          <Route exact path="/breederhomepage" component={(props) => (
            <BreederHomePage 
            // userRequestDog={this.userRequestDog} 
            />
          )} /> 

          <Route exact path="/breederprofile" component={(props) => (
            <BreederProfile {...props} breeder={breeder}/>
          )} />
            <Route exact path="/dogs" component={(props) => (
            <Dog {...props} dog={dog}/>
          )} />

           {/* <Route exact path="/updatebreederprofileform" component={(props) => (
            {breeder.map(breeder => <UpdateBreederProfileForm breeder={breeder} key={breeder.id})}
            // userRequestDog={this.userRequestDog} 
            />
           )} />  */}

      </Switch>
    </div>
  </Router>
  );
}

export default App;
